import React, { useEffect } from 'react';
import axios from 'axios';

function LandingPage() {
    useEffect(() => {
        axios.get('/')
            .then(response => {
                console.log(response);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);

    return (
        <div
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                width: "100%",
                height: "100vh",
            }}>
          <h2>시작 페이지</h2>
        </div>
    );
}

export default LandingPage;
